import React, {FC, memo} from 'react';

import classes from './Flight.module.scss';

interface Props {
	key: string;
	index: number;
	platform: string;
	stops: string;
	arrival: string;
	departure: string;
}

const Flight: FC<Props> = memo(({key, index, platform, stops, arrival, departure}) => {
	return (
		<div className={classes.wrapper} key={key}>
			<div className={classes.segment}>
				<p>#</p>
				<p>{index + 1}</p>
			</div>
			<div className={classes.segment}>
				<p>Эррайвл</p>
				<p></p>
			</div>
			<div className={classes.segment}>
				<p>Депарча</p>
				<p></p>
			</div>
			<div className={classes.segment}>
				<p>продолжительность остановки</p>
				<p></p>
			</div>
			<div className={classes.segment}>
				<p>Время в пути</p>
				<p></p>
			</div>
			<div className={classes.segment}>
				<p>
					Путь
				</p>
				<p>
					{platform}
				</p>
			</div>
			<div className={classes.segment}>
				<p>Фулл маршрут</p>
				<p></p>
			</div>
		</div>
	);
});

export default Flight;
